import React from 'react';
import { Text, View ,Pressable} from 'react-native'; // Import from 'react-native'

function PrimaryButton({ children }) {
  return (
    <Pressable>
    <View>
      <Text>{children}</Text>
    </View></Pressable>
  );
}

export default PrimaryButton;
